const e=JSON.parse('{"key":"v-7f6489a2","path":"/java/java-advanced/multi-thread/thread-methods.html","title":"Thread类中的常用方法","lang":"zh-CN","frontmatter":{"date":"2022-11-28T00:00:00.000Z","category":"基础进阶","tag":["JAVA"]},"headers":[{"level":2,"title":"Thread类中的常用的方法","slug":"thread类中的常用的方法","link":"#thread类中的常用的方法","children":[]},{"level":2,"title":"线程的优先级","slug":"线程的优先级","link":"#线程的优先级","children":[{"level":3,"title":"优先级","slug":"优先级","link":"#优先级","children":[]},{"level":3,"title":"如何获取和设置当前线程的优先级","slug":"如何获取和设置当前线程的优先级","link":"#如何获取和设置当前线程的优先级","children":[]},{"level":3,"title":"线程通信","slug":"线程通信","link":"#线程通信","children":[]},{"level":3,"title":"线程的分类","slug":"线程的分类","link":"#线程的分类","children":[]}]}],"git":{"createdTime":1669650990000,"updatedTime":1669650990000,"contributors":[{"name":"MonkeyBoss","email":"1912290362@qq.com","commits":1}]},"readingTime":{"minutes":1.38,"words":413},"filePathRelative":"java/java-advanced/multi-thread/thread-methods.md","localizedDate":"2022年11月28日","excerpt":"<h1> Thread类中的常用方法</h1>\\n<h2> Thread类中的常用的方法</h2>\\n<ol>\\n<li><code>start()</code>:启动当前线程；调用当前线程的run()</li>\\n<li><code>run()</code>: 通常需要重写Thread类中的此方法，将创建的线程要执行的操作声明在此方法中</li>\\n<li><code>currentThread()</code>:静态方法，返回执行当前代码的线程</li>\\n<li><code>getName()</code>:获取当前线程的名字</li>\\n<li><code>setName()</code>:设置当前线程的名字</li>\\n<li><code>yield()</code>:释放当前cpu的执行权</li>\\n<li><code>join()</code>:在线程a中调用线程b的join(),此时线程a就进入阻塞状态，直到线程b完全执行完以后，线程a才结束阻塞状态。</li>\\n<li><code>stop()</code>:已过时。当执行此方法时，强制结束当前线程。</li>\\n<li><code>sleep(long millitime)</code>:让当前线程“睡眠”指定的millitime毫秒。在指定的millitime毫秒时间内，当前线程是阻塞状态。</li>\\n<li><code>isAlive()</code>:判断当前线程是否存活</li>\\n</ol>"}');export{e as data};
